                <h4 style="text-align: center;"><strong>CONDITIONS G&Eacute;N&Eacute;RALES DE LOCATION</strong></h4>
<p style="text-align: left;"><strong>EXIGENCES POUR UNE LOCATION DE MOTO</strong></p>
<p>Vous devez &ecirc;tre &acirc;g&eacute; d&apos;au moins 18 ans<br>Vous devez poss&eacute;der un permis de conduire valide de la classe pilote moto<br>Vous devez avoir une carte de cr&eacute;dit</p>
