</ul>
<p><strong>QU&apos;EST-CE QUI EST INCLUS DANS LE TARIF DE LOCATION</strong></p>
<p>&nbsp;Miles illimit&eacute;s (certains mod&egrave;les) et l&apos;utilisation de pas de frais horaires de v&eacute;hicule pour une p&eacute;riode de 24 heures. &Eacute;quipement de s&eacute;curit&eacute;.</p>
<p><strong>ORIENTATION CLIENT</strong></p>
<p>&nbsp;Chaque client recevra orientation de la moto. L&apos;orientation client couvrira tous les aspects de fonctionnement de la moto en toute s&eacute;curit&eacute;, les responsabilit&eacute;s de maintenance des clients, les lois locales et nationales.</p>
<p><strong>STOCKAGE</strong></p>
<p>&nbsp;EagleRider fournira rangement pour les bagages du client, billets d&apos;avion, et autres objets de valeur gratuitement, mais au risque des clients.</p>
<p><strong>CARBURANT</strong></p>
<p>&nbsp;Les frais de carburant sont &agrave; la charge du client. EagleRider n&apos;accepte aucune responsabilit&eacute; pour la consommation de carburant de la moto et le kilom&eacute;trage. Vous pouvez rembourser par anticipation pour le remplissage de carburant. Si le carburant pr&eacute;pay&eacute;e n&apos;est pas achet&eacute; et le v&eacute;hicule doit ravitaillement, frais de 35 $ seront ajout&eacute;s.</p>
<p><strong>CASQUES (INCLUS DANS QUOTIDIEN DE LA LOCATION)</strong></p>
<p>Les casques sont fournis avec tous les moto de location et toutes les visites. Les clients sont encourag&eacute;s &agrave; apporter leurs propres casques pour le confort et le style. En outre, les casques peuvent &ecirc;tre achet&eacute;s &agrave; un grand nombre de stations de location EagleRider. Les casques sont tenus par la loi dans la plupart des endroits.</p>
<p><strong>PILOTES SUPPL&Eacute;MENTAIRES</strong></p>
<p>1 conducteur suppl&eacute;mentaire est autoris&eacute; sans frais suppl&eacute;mentaires. L&apos;&acirc;ge minimum pour un conducteur suppl&eacute;mentaire est de 18 et un permis moto valide est n&eacute;cessaire.</p>
<p><strong>ENTRETIEN RESPONSABILIT&Eacute;</strong></p>
<p>Le client est responsable de la v&eacute;rification des niveaux d&apos;huile moteur &agrave; chaque ravitaillement et rapporter les pannes m&eacute;caniques imm&eacute;diatement. Instructions et les proc&eacute;dures de remboursement des frais d&apos;entretien sont fournis &agrave; pick-up. Les clients peuvent &ecirc;tre tenus responsables des dommages m&eacute;caniques dus &agrave; la n&eacute;gligence dans le fonctionnement de la moto ou pour d&eacute;faut d&apos;entretien normal.</p>
<p><strong>MOTO REMPLACEMENT</strong></p>
<p>EagleRider se r&eacute;serve le droit de remplacer le moto confirm&eacute; au client de la location. Si EagleRider pas &ecirc;tre en mesure de fournir moto confirm&eacute; un mod&egrave;le similaire ou meilleure sera fourni au client. Ceci constitue la responsabilit&eacute; maximale de EagleRider.</p>
<p><strong>D&Eacute;P&Ocirc;T DE GARANTIE</strong></p>
<p>Un d&eacute;p&ocirc;t de garantie de 1000$ - 3000$ sera prise &agrave; pick-up (autorisation uniquement). D&eacute;p&ocirc;t de garantie doit &ecirc;tre trait&eacute;e via une carte de cr&eacute;dit valide.</p>
<p><strong>RESTRICTION</strong></p>
<p>Toute violation de cette liste entrainera l&rsquo;annulation de l&rsquo;assurance VIP Theft &amp; Damage Waivers et le client sera responsable pour tous d&eacute;g&acirc;ts. Restriction Route：Toutes les motos sont interdites dans les chemins en gravier, plages, ou autres chemins non-publics. Restriction Mexique：Les clients ne peuvent pas entrer au Mexique avec une moto Am&eacute;ricaine sans une autorisation &eacute;crite ou sans &ecirc;tre accompagn&eacute; par un guide EagleRider.<br>AVERTISSEMENT Vall&eacute;e de la Mort: La vall&eacute;e de la mort est tr&egrave;s dangereuse &agrave; cause de la chaleur pendant les mois de Juin et Aout et n&rsquo;est pas recommand&eacute;e.</p>
<p><strong>RESERVATION AND DEPOSIT</strong></p>
<p>Au moment de la r&eacute;servation, un acompte de 20% est n&eacute;cessaire pour toute r&eacute;servation exc&eacute;dant 1 000 USD et toute r&eacute;servation effectu&eacute;e plus de 30 jours avant la date de r&eacute;cup&eacute;ration de la moto. Le solde restant devra &ecirc;tre pay&eacute; dans son int&eacute;gralit&eacute; dans les 30 jours avant la date de r&eacute;cup&eacute;ration de la moto. Dans les autres cas de figure, le paiement complet est requis sous 30 jours avant la date de r&eacute;cup&eacute;ration de la moto. En cliquant sur &ldquo;R&eacute;server&rdquo; lors de votre d&eacute;connexion, vous autorisez EagleRider &agrave; d&eacute;biter votre carte de cr&eacute;dit 30 jours avant la date de r&eacute;cup&eacute;ration des motos. Vous autorisez &eacute;galement EagleRider &agrave; r&eacute;it&eacute;rer toute transaction sur votre ou vos cardes n&rsquo;ayant pas &eacute;t&eacute; honor&eacute;e.<br>Si vous souhaitez r&eacute;gler le solde restant pus t&ocirc;t ou avec un moyen de paiement diff&egrave;rent, merci de nous contacter par t&eacute;l&eacute;phone et de prendre vos dispositions avant la date d&apos;exigibilit&eacute; du solde telle qu&rsquo;indiqu&eacute;e sur votre page de confirmation et votre email de confirmation. Si, en cas de paiement par virement bancaire ou ch&egrave;que, le solde restant n&rsquo;est pas re&ccedil;u sous les 30 jours avant la r&eacute;cup&eacute;ration de la moto, EagleRider se r&eacute;serve le droit d&rsquo;annuler la location et des frais d&rsquo;annulation vous seront factur&eacute;s.</p>
<p><strong>POLITIQUE DE RETOUR</strong></p>
<p>&nbsp;Une journ&eacute;e de location est de 24 heures. Des frais de 25 $ l&apos;heure peut s&apos;appliquer pour les v&eacute;hicules retourn&eacute;s tard.</p>
<p><strong>POLITIQUE DE REMBOURSEMENT</strong></p>
<p>&nbsp;Toutes les r&eacute;servations de location confirm&eacute;s ne sont pas remboursables, sauf indication sous celui des directives de r&eacute;servation de protection d&apos;annulation (voir ci-dessous). Aucun remboursement sur les premiers retours.</p>
<p><strong>AVOIRS</strong></p>
<p>&nbsp;Les avoirs appartenant &agrave; un particulier ne peuvent &ecirc;tre utilis&eacute;s que pour des r&eacute;servations effectu&eacute;es par et pour cet individu. Les avoirs peuvent &ecirc;tre utilis&eacute;s une fois par paiement (donc une fois lors de la r&eacute;servation et plusieurs lors de paiements ult&eacute;rieurs). Les avoirs expirent un an apr&egrave;s la date d&rsquo;&eacute;mission.</p>
<p><strong>MODES DE PAIEMENT</strong></p>
<p>&nbsp;Le service location Harley d&apos;EagleRIder accepte les modes de paiements suivants:Ch&egrave;ques de voyage, Esp&egrave;ces, Cartes de Cr&eacute;dit (VISA, Master Card, AMEX, Discover, Diners, JCB). Le d&eacute;p&ocirc;t de garanti ne peut &ecirc;tre r&eacute;gl&eacute; par ch&egrave;que de voyage.</p>
