<strong><span style="font-size: 19px;">Assurance et des plans de protection</span></strong>
<p><strong>POLITIQUES ET SURTAXES ASSURANCE</strong></p>
<p>&nbsp;&Eacute;tat d&apos;assurance de responsabilit&eacute; obligatoire est inclus dans votre location. S&apos;il vous pla&icirc;t v&eacute;rifiez aupr&egrave;s de votre agence de location qui sont les exigences de l&apos;Etat. Vous n&apos;&ecirc;tes pas assur&eacute; pour les dommages ou vol. EagleRider offre plusieurs options de mise &agrave; niveau de votre responsabilit&eacute; ou Damage Waiver. S&apos;il vous pla&icirc;t v&eacute;rifier avec soin le fournisseur d&apos;assurance. Car les locations de moto sont consid&eacute;r&eacute;s comme une location exotique plupart des cartes de cr&eacute;dit et d&apos;assurance ne transf&egrave;rent pas de la m&ecirc;me mani&egrave;re comme ils le font avec des locations de voiture normale. S&apos;IL VOUS PLA&Icirc;T v&eacute;rifier toujours votre compagnie de cr&eacute;dit ou une entreprise d&apos;assurance pour la couverture.</p>
<p><strong>COUVERTURE SANS FRANCHISE</strong></p>
<p>&nbsp;Toutes les options d&rsquo;assurance vol et dommages et d&rsquo;assurance responsabilit&eacute; civile suppl&eacute;mentaire sont soumises aux conditions expresses du contrat de location et ne couvrent pas les dommages corporels ou mat&eacute;riels r&eacute;sultant de n&eacute;gligences, telles que l&rsquo;utilisation ill&eacute;gale ou utilisation de la location sous l&apos;influence de drogues ou d&apos;alcool. Un rapport de police est requis pour tout dommage ou accident. Tout dommage caus&eacute; &agrave; une moto lou&eacute;e sans rapport de police sera consid&eacute;r&eacute; comme la faute du loueur.</p>
<p>L&rsquo;assurance de responsabilit&eacute; civile compl&eacute;mentaire fournit une assurance suppl&eacute;mentaire &agrave; hauteur des limites de responsabilit&eacute;s requises par l&rsquo;&eacute;tat.</p>
<p>Notez que l&rsquo;ARCC est compl&eacute;mentaire et secondaire &agrave; toute autre assurance disponible o&ugrave; la loi l&rsquo;autorise.</p>
