rmine, le vice inh&eacute;rent ou les dommages subis du fait de tout processus ou en cours de travail ou en r&eacute;sultant, ou sous la garde, la surveillance ou le contr&ocirc;le d&apos;un transporteur public.<br>Pertes caus&eacute;es par la guerre ou tout acte de guerre;<br>Transport de marchandises de contrebande ou du commerce ill&eacute;gal;<br>Perte par r&eacute;action nucl&eacute;aire, radiation ou contamination radioactive;<br>Perte ou dommages dus au vol, sauf si signal&eacute;s &agrave; la police.<br>Toutes les pertes dues au vol doivent &ecirc;tre signal&eacute;es aux forces de l&rsquo;ordre et une copie du rapport d&eacute;pos&eacute; doit &ecirc;tre pr&eacute;sent&eacute;e au bureau de location, sinon elles ne seront pas prises en charge. La couverture ne s&rsquo;applique en cas de violation du contrat de location par le loueur.<br><br>La valeur marchande actuelle de la propri&eacute;t&eacute; r&eacute;clam&eacute;e sera consid&eacute;r&eacute;e comme raisonnable et acceptable pour un remboursement en vertu de cette couverture.<br><br><strong>ASSISTANCE SUR LA ROUTE</strong></p>
<p>La Protection Assistance sur la Route vous permet d&rsquo;avoir une assistance sur la route par un vendeur partenaire EagleRider ainsi qu&rsquo;un service de d&eacute;pannage au cas ou votre moto soit en panne. Les avantages dont vous b&eacute;n&eacute;ficiez sont les suivants, service de d&eacute;pannage (jusqu&rsquo;&agrave; 50 kilom&egrave;tres du lieu de la panne), livraison d&rsquo;essence en urgence (jusqu&rsquo;&agrave; 8 litres) et rechargement de batterie. En prenant la Protection Assistance sur la Route, nous annulerons vos frais de d&eacute;pannage ou de service d&rsquo;assistance &agrave; hauteur de $500/USD par accident.<br><br><strong>GARANTIE DU MOD&Egrave;LE DE MOTO</strong>&nbsp;</p>
<p>En choisissant notre option &laquo; Mod&egrave;le de Moto Garantie &raquo;, vous &ecirc;tes assur&eacute; que le mod&egrave;le que vous avez choisi sera disponible &agrave; votre arriv&eacute;e. Si vous d&eacute;cidez de ne pas prendre l&rsquo;option et que malheureusement le mod&egrave;le de votre choix n&rsquo;est pas disponible en arrivant, vous aurez quand m&ecirc;me la garantie d&rsquo;obtenir un mod&egrave;le de la m&ecirc;me gamme.<strong><br></strong><br><strong>LIEUX INTERNATIONAUX</strong></p>
