<p>EagleRider met son savoir-faire au service de votre voyage. Nous nous chargeons de toute l&apos;organisation de votre excursion et fournissons tout l&apos;&eacute;quipement n&eacute;cessaire vous permettant de profiter pleinement du paysage, de faire de nouvelles rencontres et d&apos;imaginer votre prochain voyage au sein de notre compagnie.</p>
<p><strong>CONFIRMATION DE LOCATION ET D&Eacute;P&Ocirc;T DE GARANTIE PAR CARTE DE CR&Eacute;DIT</strong></p>
<p>En signant le Contrat de Location ainsi que le formulaire de D&eacute;p&ocirc;t de Garantie, vous acceptez les termes et conditions des dits contrats ex&eacute;cutoires vous liant &agrave; EagleRider. Assurez vous de les lire attentivement. Sans ces documents, d&ucirc;ment sign&eacute;s, EagleRider ne pourra accepter votre participation.</p>
<p><strong>R&Eacute;SERVATION ET D&Eacute;P&Ocirc;T DE GARANTIE</strong></p>
<p>Un acompte de 1000$ est requis au moment de la r&eacute;servation. Ce d&eacute;p&ocirc;t n&apos;est pas remboursable. Le solde doit &ecirc;tre pay&eacute; au moins 65 jours avant le commencement du circuit organis&eacute;. En signant le formulaire d&apos;autorisation de carte de cr&eacute;dit vous donnez la permission &agrave; EagleRider de pr&eacute;lever ce montant 65 jours avant la date butoir. Si ce d&eacute;lai n&apos;est pas respect&eacute; EagleRider se r&eacute;serve le droit de consid&eacute;rer la r&eacute;servation comme caduque et d&apos;appliquer des frais d&apos;annulation.</p>
<p><strong>D&Eacute;CHARGE DE RESPONSABILIT&Eacute; ET DE RENONCIATION</strong></p>
<p>Chaque participant au circuit EagleRider est tenu d&apos;accepter et de signer un Contrat de Location ainsi qu&apos;un formulaire lib&eacute;ration et renonciation, et ce, avant le d&eacute;but de l&apos;excursion. EagleRider sera dans l&apos;obligation de refuser tout participant qui n&apos;aurait pas ces documents d&ucirc;ment remplis. Ces formulaires peuvent &ecirc;tre fournis &agrave; votre demande par l&apos;un de nos agents.</p>
<p><strong>BAGAGE</strong></p>
<p>EagleRider n&apos;assume aucune responsabilit&eacute; en cas de perte, dommage ou retard dans la livraison des bagages des participants. Une assurance bagages est recommand&eacute;e.</p>
<p><strong>ANNULATION ET REMBOURSEMENT</strong></p>
<p>Une r&eacute;servation peut &ecirc;tre annul&eacute;e jusqu&apos;&agrave; 45 jours ou plus avant la date de prise en charge sans frais. 50% du montant total de la r&eacute;servation sera appliqu&eacute; aux frais d&apos;annulation si la r&eacute;servation est annul&eacute;e entre 44 et 31 jours apr&egrave;s la prise en charge. 100% de la r&eacute;servation sera appliqu&eacute; aux frais d&apos;annulation si la r&eacute;servation est annul&eacute;e dans les 30 jours suivant l&apos;heure de prise en charge ou si le client ne se pr&eacute;sente pas. Les remboursements, le cas &eacute;ch&eacute;ant, seront &eacute;mis sous forme de cr&eacute;dit de magasin qui peut &ecirc;tre &eacute;chang&eacute; dans un d&eacute;lai d&apos;un an &agrave; compter de la date d&apos;&eacute;mission.<small><br><br>Veuillez noter: des frais d&apos;administration de 25 $ seront appliqu&eacute;s &agrave; une r&eacute;servation modifi&eacute;e entre 30 et 11 jours avant l&apos;heure de prise en charge.</small></p>
<p><strong>ANNULATION DU CIRCUIT</strong></p>
<p>Dans l&apos;&eacute;ventualit&eacute; d&apos;une annulation les clients en seront imm&eacute;diatement inform&eacute;s et pourront choisir entre deux solutions, opter pour la formule circuit individuel (location de motos et h&ocirc;tels) ou payer un suppl&eacute;ment afin d&apos;int&eacute;grer un groupe plus restreint. Si les clients refusent de payer ce suppl&eacute;ment, alors EagleRider remboursera le paiement int&eacute;gralement, ce qui mettra un terme &agrave; toute r&eacute;clamation. EagleRider ne peut &ecirc;tre tenu pour responsable quant aux suppl&eacute;ments ou aux pertes inh&eacute;rents &agrave; une annulation pour manque de participants. Ceci inclut mais ne se limite pas au co&ucirc;t des billets d&apos;avions pay&eacute;s en avance, aux frais de r&eacute;servations de chambre d&apos;h&ocirc;tel ou encore de location de voiture. Il peut arriver que, pour une raison ind&eacute;pendante de notre volont&eacute; le circuit soit annul&eacute;, report&eacute; ou avanc&eacute;, que l&apos;itin&eacute;raire soit modifi&eacute; de m&ecirc;me que le choix des h&ocirc;tels, les guides touristiques etc). Dans ce cas, nous n&apos;assumons aucune responsabilit&eacute; quant aux pertes &eacute;conomiques engendr&eacute;es par ces modifications. Si le voyage est annul&eacute; avant la date pr&eacute;vue du d&eacute;but de l&apos;excursion alors le prix du circuit vous sera int&eacute;gralement rembours&eacute;. EagleRider recommande que vous optiez pour une assurance voyage, sant&eacute; et accident ad&eacute;quate ainsi qu&rsquo;une assurance annulation de voyage.</p>
<p><strong>NON-RESPECT DES LOIS DE LA CIRCULATION ET/OU R&Eacute;GLEMENTATION DES VOYAGES EN GROUPE.</strong></p>
<p>Si les lois de la circulation ou les r&eacute;glementations des circuits en groupe ne sont pas respect&eacute;es EagleRider sera dans l&apos;obligation de r&eacute;silier le contrat en cours et la moto sera immobilis&eacute;e. Les burnout sont formellement interdits.</p>
<p><strong>CONDITIONS DE LOCATION</strong></p>
<ul>
    <li>De 21 ans ou plus&nbsp;</li>
    <li>Permis de moto valide op&eacute;rateur&nbsp;</li>
    <li>Minimum d&apos;un an d&apos;exp&eacute;rience de conduite sur motos de grosse cylindr&eacute;e&nbsp;</li>
    <li>Principales cartes de cr&eacute;dit est n&eacute;cessaire&nbsp;</li>
